INSERT INTO `shop_faq` VALUES (1, 'b65c90a9-234e-46d3-82b5-c3e6f86f62ed', 'Q: Can we get this product with better price?', '<p>A: Yes, the price writed here is for MOQ 50pcs, the more order quantity the better price, please contact us to get better price.</p>', NULL, 'en', 1, 30, '2021-2-17 21:12:18', '2021-4-18 21:01:53');
INSERT INTO `shop_faq` VALUES (3, '68a4b03a-f5b4-465f-b582-8c05fe01091a', 'Q:What is the lead time for this products?', '<p>A:Usually the lead time is about 2 weeks after decided order.</p>', NULL, 'en', 1, 60, '2021-2-17 21:43:05', '2021-4-18 21:01:10');
INSERT INTO `shop_faq` VALUES (4, '87fcafad-e985-48a2-9f46-7a8770ae1cca', '  Q: Can you arrange the logistics for these products?', '<p>A: Yes, but the shipping cost is expensive to ship by air for pure battery, we advice to ship by sea or by train DDP way.</p>', NULL, 'en', 1, 80, '2021-2-17 21:43:17', '2021-4-18 21:05:40');
INSERT INTO `shop_faq` VALUES (5, 'c09b73fb-0da3-43b3-be62-5ec214fabb85', 'Q: Can you provide OEM or ODM service for this product?', '<p>A: Yes, we are a factory and professinally provide OEM ODM service for li-ion battery solutions.</p>', NULL, 'en', 1, 100, '2021-3-17 21:00:14', '2021-4-18 21:06:00');
