INSERT INTO `shop_faq` VALUES (11, '15cfa70b-ef64-4bd9-8c76-5b9b6e1dab43', 'Q: What type of battery are used for this products?', '<p>A: LiFePo4 26650 battery cell with safty and long life cycle time over 2000 time 80% Left.&nbsp;</p><p><br/></p>', NULL, 'en', 1, 0, '2021-4-18 19:50:26', '2021-4-18 21:05:18');
INSERT INTO `shop_faq` VALUES (12, 'd7d655ba-1ca1-4d33-b218-6bc5159151d0', 'Q: Where can I buy this model? ', '<p>A: You contact us to order directly from Jetech factory, or buy from seller online such aliexpress shop.</p><p><br/></p>', NULL, 'en', 1, 0, '2021-4-18 19:51:10', '2021-4-18 21:05:06');
INSERT INTO `shop_faq` VALUES (13, 'ca9b01c9-bac3-47a8-ba7b-de378daedcea', 'Q: Can I buy one of this product?', '<p>A: We are a factory to mass make this product with MOQ 50pcs, if you need, please contact us by E-mail.</p><p><br/></p>', NULL, 'en', 1, 0, '2021-4-18 19:53:19', '2021-4-18 21:03:30');
INSERT INTO `shop_faq` VALUES (14, '11876408-75aa-40ae-a035-2b9f12c48c7d', 'Q: What devices can use with this power station?', '<p>A: Please note that the AC output port can only charge/power devices that operate at less than Max-Watt. Once exceeding, power station will shut off automatically. Please refer to your device specification before purchase.</p><p><br/></p>', NULL, 'en', 1, 0, '2021-4-18 19:53:33', '2021-4-18 21:03:15');
INSERT INTO `shop_faq` VALUES (15, '6dee8e11-8745-4b34-a02f-36a6e5889f5d', ' Q: How do I know the working time for my device with this portation?', '<p>A: Usually the working time = 500Wh* 0.85 / operating power of your device.</p><p>For reference, assuming power consumption of your device is 60W (might be a box fan), working time will be 500Wh*0.85/60w=7hrs (rough calculated) . Please note: actual power consumption varies from different usages, please consult JETECH for better purchase decision.</p><p><br/></p>', NULL, 'en', 1, 0, '2021-4-18 19:53:48', '2021-4-18 21:03:01');
INSERT INTO `shop_faq` VALUES (16, '32e4fe36-f33f-4db7-9df4-2ade28cbf5f8', 'Q: Do you have any certifications for this product?', '<p>A: Yes, CE, MSDS, Rosh, SGS and UN38.3 etc.</p>', NULL, 'en', 1, 0, '2021-4-18 19:54:39', '2021-4-18 21:02:48');
INSERT INTO `shop_faq` VALUES (17, '6581d434-3ce1-42ee-b94c-ec4267050dde', 'Q: How do we make the payment?', '<p>A: We accept T/T, West Union, Paypal, L/C etc payment.</p>', NULL, 'en', 1, 0, '2021-4-18 19:54:52', '2021-4-18 21:02:36');
INSERT INTO `shop_faq` VALUES (18, '7999f593-853d-4412-8231-b1f83427995c', 'Q: What is the minimum order quantity?', '<p>A: Usually the MOQ is 50pcs, if we have in stock, no MOQ limit.</p>', NULL, 'en', 1, 0, '2021-4-18 19:55:04', '2021-4-18 21:02:23');
